<!DOCTYPE html>
<meta charset="utf-8">
<html>

<head>
    <title>聖和さま</title>

    <script src="https://cdn.bootcss.com/jquery/3.2.1/jquery.min.js"></script>
    <style>
        #ti {
            font-size: 75px;
            font-family: KaiTi;
            font-style: oblique;
            color: rgb(252, 252, 252, 75%)
        }
        
        #ti:hover {
            cursor: default
        }
        
        #serch1 {
            text-align: left;
            background: #ffffff;
            width: 500px;
            border-width: 0px;
            border-radius: 40px;
            padding: 15px 20px;
            font-family: Arial, Helvetica, sans-serif;
            font-size: 24px;
            font-weight: 1;
            opacity: 0.5;
        }
        
        #girl {
            position: absolute;
            bottom: 3px;
        }
        
        .waifu {
            position: fixed;
            bottom: 0;
            right: 1%;
            z-index: 1;
            font-size: 0;
            transition: all .3s ease-in-out;
            -webkit-transform: translateY(3px);
            transform: translateY(3px);
        }
        
        .waifu:hover {
            -webkit-transform: translateY(0);
            transform: translateY(0);
        }
        
        @media (max-width: 768px) {
            .waifu {
                display: none;
            }
        }
        
        .waifu-tips {
            opacity: 0;
            width: 250px;
            height: 70px;
            margin: -20px 20px;
            padding: 5px 10px;
            border: 1px solid rgba(255, 245, 238, 0.5);
            /*(224, 186, 140, 0.62)*/
            border-radius: 12px;
            background-color: rgba(255, 245, 238, 0.5);
            box-shadow: 0 3px 15px 2px rgba(191, 158, 118, 0.2);
            font-size: 12px;
            text-overflow: ellipsis;
            overflow: hidden;
            position: absolute;
            animation-delay: 5s;
            animation-duration: 50s;
            animation-iteration-count: infinite;
            animation-name: shake;
            animation-timing-function: ease-in-out;
        }
        
        .waifu-tool {
            display: none;
            color: #aaa;
            top: 50px;
            right: 10px;
            font-size: 14px;
            position: absolute;
        }
        /*
.waifu:hover .waifu-tool {
    display: block;
}
*/
        
        .waifu-tool span {
            display: block;
            cursor: pointer;
            color: #5b6c7d;
            line-height: 20px;
            transition: 0.2s;
        }
        
        .waifu-tool span:hover {
            color: #34495e;
        }
        
        .waifu #live2d {
            position: relative;
        }
        
        @keyframes shake {
            2% {
                transform: translate(0.5px, -1.5px) rotate(-0.5deg);
            }
            4% {
                transform: translate(0.5px, 1.5px) rotate(1.5deg);
            }
            6% {
                transform: translate(1.5px, 1.5px) rotate(1.5deg);
            }
            8% {
                transform: translate(2.5px, 1.5px) rotate(0.5deg);
            }
            10% {
                transform: translate(0.5px, 2.5px) rotate(0.5deg);
            }
            12% {
                transform: translate(1.5px, 1.5px) rotate(0.5deg);
            }
            14% {
                transform: translate(0.5px, 0.5px) rotate(0.5deg);
            }
            16% {
                transform: translate(-1.5px, -0.5px) rotate(1.5deg);
            }
            18% {
                transform: translate(0.5px, 0.5px) rotate(1.5deg);
            }
            20% {
                transform: translate(2.5px, 2.5px) rotate(1.5deg);
            }
            22% {
                transform: translate(0.5px, -1.5px) rotate(1.5deg);
            }
            24% {
                transform: translate(-1.5px, 1.5px) rotate(-0.5deg);
            }
            26% {
                transform: translate(1.5px, 0.5px) rotate(1.5deg);
            }
            28% {
                transform: translate(-0.5px, -0.5px) rotate(-0.5deg);
            }
            30% {
                transform: translate(1.5px, -0.5px) rotate(-0.5deg);
            }
            32% {
                transform: translate(2.5px, -1.5px) rotate(1.5deg);
            }
            34% {
                transform: translate(2.5px, 2.5px) rotate(-0.5deg);
            }
            36% {
                transform: translate(0.5px, -1.5px) rotate(0.5deg);
            }
            38% {
                transform: translate(2.5px, -0.5px) rotate(-0.5deg);
            }
            40% {
                transform: translate(-0.5px, 2.5px) rotate(0.5deg);
            }
            42% {
                transform: translate(-1.5px, 2.5px) rotate(0.5deg);
            }
            44% {
                transform: translate(-1.5px, 1.5px) rotate(0.5deg);
            }
            46% {
                transform: translate(1.5px, -0.5px) rotate(-0.5deg);
            }
            48% {
                transform: translate(2.5px, -0.5px) rotate(0.5deg);
            }
            50% {
                transform: translate(-1.5px, 1.5px) rotate(0.5deg);
            }
            52% {
                transform: translate(-0.5px, 1.5px) rotate(0.5deg);
            }
            54% {
                transform: translate(-1.5px, 1.5px) rotate(0.5deg);
            }
            56% {
                transform: translate(0.5px, 2.5px) rotate(1.5deg);
            }
            58% {
                transform: translate(2.5px, 2.5px) rotate(0.5deg);
            }
            60% {
                transform: translate(2.5px, -1.5px) rotate(1.5deg);
            }
            62% {
                transform: translate(-1.5px, 0.5px) rotate(1.5deg);
            }
            64% {
                transform: translate(-1.5px, 1.5px) rotate(1.5deg);
            }
            66% {
                transform: translate(0.5px, 2.5px) rotate(1.5deg);
            }
            68% {
                transform: translate(2.5px, -1.5px) rotate(1.5deg);
            }
            70% {
                transform: translate(2.5px, 2.5px) rotate(0.5deg);
            }
            72% {
                transform: translate(-0.5px, -1.5px) rotate(1.5deg);
            }
            74% {
                transform: translate(-1.5px, 2.5px) rotate(1.5deg);
            }
            76% {
                transform: translate(-1.5px, 2.5px) rotate(1.5deg);
            }
            78% {
                transform: translate(-1.5px, 2.5px) rotate(0.5deg);
            }
            80% {
                transform: translate(-1.5px, 0.5px) rotate(-0.5deg);
            }
            82% {
                transform: translate(-1.5px, 0.5px) rotate(-0.5deg);
            }
            84% {
                transform: translate(-0.5px, 0.5px) rotate(1.5deg);
            }
            86% {
                transform: translate(2.5px, 1.5px) rotate(0.5deg);
            }
            88% {
                transform: translate(-1.5px, 0.5px) rotate(1.5deg);
            }
            90% {
                transform: translate(-1.5px, -0.5px) rotate(-0.5deg);
            }
            92% {
                transform: translate(-1.5px, -1.5px) rotate(1.5deg);
            }
            94% {
                transform: translate(0.5px, 0.5px) rotate(-0.5deg);
            }
            96% {
                transform: translate(2.5px, -0.5px) rotate(-0.5deg);
            }
            98% {
                transform: translate(-1.5px, -1.5px) rotate(-0.5deg);
            }
            0%,
            100% {
                transform: translate(0, 0) rotate(0);
            }
        }
        
        @font-face {
            font-family: 'Flat-UI-Icons';
            src: url('flat-ui-icons-regular.eot');
            src: url('flat-ui-icons-regular.eot?#iefix') format('embedded-opentype'), url('flat-ui-icons-regular.woff') format('woff'), url('flat-ui-icons-regular.ttf') format('truetype'), url('flat-ui-icons-regular.svg#flat-ui-icons-regular') format('svg');
        }
        
        [class^="fui-"],
        [class*="fui-"] {
            font-family: 'Flat-UI-Icons';
            speak: none;
            font-style: normal;
            font-weight: normal;
            font-variant: normal;
            text-transform: none;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
        }
        
        .fui-cross:before {
            content: "\e609";
        }
        
        .fui-info-circle:before {
            content: "\e60f";
        }
        
        .fui-photo:before {
            content: "\e62a";
        }
        
        .fui-eye:before {
            content: "\e62c";
        }
        
        .fui-chat:before {
            content: "\e62d";
        }
        
        .fui-home:before {
            content: "\e62e";
        }
        
        .fui-user:before {
            content: "\e631";
        }
    </style>
    <script>
        function aaa() {
            var d = document.getElementById("div1");
            d.style.color = "";
        }
    </script>
</head>

            var tokenReg = /(\\)?\{([^\{\}\\]+)(\\)?\}/g;

            return this.replace(tokenReg, function(word, slash1, token, slash2) {
                if (slash1 || slash2) {
                    return word.replace('\\', '');
                }

                var variables = token.replace(/\s/g, '').split('.');
                var currentObject = context;
                var i, length, variable;

                for (i = 0, length = variables.length; i < length; ++i) {
                    variable = variables[i];
                    currentObject = currentObject[variable];
                    if (currentObject === undefined || currentObject === null) return '';
                }
                return currentObject;
            });
        };

        function showMessage(text, timeout, flag) {
            if (flag || sessionStorage.getItem('waifu-text') === '' || sessionStorage.getItem('waifu-text') === null) {
                if (Array.isArray(text)) text = text[Math.floor(Math.random() * text.length + 1) - 1];

                if (flag) sessionStorage.setItem('waifu-text', text);

                $('.waifu-tips').stop();
                $('.waifu-tips').html(text).fadeTo(200, 1);
                if (timeout === undefined) timeout = 5000;
                hideMessage(timeout);
            }
        }

        function hideMessage(timeout) {
            $('.waifu-tips').stop().css('opacity', 1);
            if (timeout === undefined) timeout = 5000;
            window.setTimeout(function() {
                sessionStorage.removeItem('waifu-text')
            }, timeout);
            $('.waifu-tips').delay(timeout).fadeTo(200, 0);
        }

        function initModel(waifuPath) {

            if (waifuPath === undefined) waifuPath = '';

            var modelTexturesId = localStorage.getItem('modelTexturesId');

            if (modelId == null) {

                        });

                            var text = tips.text;

                                text: $(this).text()
                            });
                            showMessage(text, 3000, true);
                        });

                        var now = new Date();
                        var after = tips.date.split('-')[0];
                        var before = tips.date.split('-')[1] || after;

                        if ((after.split('/')[0] <= now.getMonth() + 1 && now.getMonth() + 1 <= before.split('/')[0]) &&

                            text = text.render({

                            });

                        }
                    });
                }
            });
